import React from 'react';

import classes from './Stars.module.css';

import star from '../../../../assets/Results/star.png';

const Stars = () => (
    <div className={classes.Stars}>
        <img src={star} alt="Star"/>
        <img src={star} alt="Star"/>
        <img src={star} alt="Star"/>
        <img src={star} alt="Star"/>
        <img src={star} alt="Star"/>
    </div>
);

export default Stars;
